css:
@-moz-document domain("google.com")
{
    body
    {
        background-image: url(https://i.imgur.com/hN5el73.png);
        min-height: 0;
        background-position: top;
        background-repeat: repeat-y;
        background-size: cover;
    }

    /*hide google logo*/
    .k1zIA.rSk4se img.lnXdpd
    {
        display: none;
    }

    /*google logo image*/
    .k1zIA.rSk4se
    {
        background: url(https://i.imgur.com/TzdD75m.png);
        width: 200px;
        height: 100px;
        background-size: contain;
        background-repeat: no-repeat;
        transform: scale(2.5);
    }
    .RNNXgb
    {
        background-color: #691f1f !important;
        color: #ee2e2d !important;
        border: 3px solid #ee2e2d;
    }
    .RNNXgb input
    {
        color: #ee2e2d !important;
    }
    .RNNXgb svg path
    {
        color: #ee2e2d !important;
    }
    /*bottom buttons*/
    input[type="submit"]
    {
        border: 3px solid #ee2e2d !important;
        background: #691f1f !important;
        color: #ee2e2d !important;
    }

}

@-moz-document regexp(".*google\.com\/search.*") {
    body
    {
        background-image: unset;
    }

    body, .gke0pe, .gke0pe *, body #searchform *, .appbar, .appbar *, #top_nav, #top_nav *, .N60sec, .N60sec *,
    #center_col, #center_col *, #rhs, #rhs *
    {
        background-color: black !important;
        color: #ee2e2d !important;
        border-color: #ee2e2d !important;
    }
    body #main div:empty, body #main span:empty, body #searchform div:empty, body #searchform span:empty {
        visibility: hidden;
    }
    body #main .fluWKd {

    }
    body #main .k8XOCe {
        border: 3px solid #ee2e2d !important;
        background-color: #691f1f !important;
        color: #ee2e2d !important;
    }
    body #main .k8XOCe .aXBZVd {
        visibility: visible;
        background-color: #691f1f !important;
    }
    body #main .k8XOCe .s75CSd {
        background-color: #691f1f !important;
    }
    body #main .k8XOCe .s75CSd * {
        background-color: #691f1f !important;
    }
    #logo
    {
        background: url("https://i.imgur.com/TzdD75m.png") 50% 80% no-repeat !important;
        background-size: contain !important;
        padding-bottom: 80px !important;
        bottom: 70px !important;
    }

}
